import React, { useEffect } from 'react';
import './App.css';

function App() {
  useEffect(() => {
    const key = '85062f74bccf4b33872bf17c11caaae6';
    const url = `https://newsapi.org/v2/everything?q=tesla&from=2021-09-27&sortBy=publishedAt&apiKey=${key}`;

    fetch(url)
      .then((response) => response.json())
      .then((response) => {
        console.log(response);
      });
  });
  return (
    <div className='App'>
      <h1>Hey</h1>
    </div>
  );
}

export default App;
